import Layout from "../components/MyLayout";
import Header from '../components/Header';
import { Component } from "react";

export default class About extends Component {

    render() {
        return (

            <div>
                <Header />
                <Layout >
                    About Project release management!
            </Layout>


            </div>
        )
    }

}
